import { Route, Switch } from "react-router-dom";

import "../css/app.css";

import PrivateRoute from "./PrivateRoute";

import UserStartPage from "./UserStartPage";
import WorkerLoginPage from "./WorkerLoginPage";
import StartingPage from "./StartingPage";
import WorkerStartPage from "./WorkerStartPage";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/" exact>
          <StartingPage />
        </Route>
        <Route path="/UserStartPage">
          <UserStartPage />
        </Route>
        <Route path="/WorkerLoginPage">
          <WorkerLoginPage />
        </Route>
        <PrivateRoute path="/WorkerStartPage">
          <WorkerStartPage />
        </PrivateRoute>
      </Switch>
    </div>
  );
}

export default App;
